import React, { Component } from "react";
import { Link } from "react-router-dom";

class AddClient extends Component {
  render() {
    return (
      <div className="row">
        <div className="col-md-6">
          <Link to="/" className="btn btn-link">
            Back to Dashboard
          </Link>
        </div>
      </div>
    );
  }
}

export default AddClient;
